import React, { useState } from "react";
import { Leaf, BarChart3, Bell, Brain, Camera, ChevronRight } from "lucide-react";

export default function AgroTechLanding() {
  const [activeModule, setActiveModule] = useState(0);

  const colors = {
    primary: "#0AB998",
    secondary: "#009100",
    accent: "#FFBD1F",
    white: "#FFFFFF",
  };

  const modules = [
    {
      title: "Monitoring & Historisation",
      icon: BarChart3,
      points: [
        "Collecte multi-protocoles (MQTT, REST, WebSockets)",
        "Variables air, sol, système en temps réel",
        "TimescaleDB pour séries temporelles haute performance",
        "Dashboards interactifs et cartes géolocalisées",
      ],
    },
    {
      title: "Alertes Intelligentes",
      icon: Bell,
      points: [
        "Moteur de règles composées et ML",
        "Détection stress hydrique et thermique",
        "Prévention risques phytosanitaires",
        "Notifications multi-canaux avec escalade",
      ],
    },
    {
      title: "IA & Recommandations",
      icon: Brain,
      points: [
        "Modèles prédictifs besoins hydriques",
        "Optimisation fertigation NPK temps réel",
        "Gestion climatique intelligente (CO₂, éclairage)",
        "Algorithmes génétiques multi-objectifs",
      ],
    },
    {
      title: "Vision Artificielle",
      icon: Camera,
      points: [
        "CNN pour détection maladies foliaires",
        "Suivi croissance et mesures biométriques",
        "Comptage fruits et estimation rendements",
        "Classification qualité récolte automatisée",
      ],
    },
  ];

  return (
    <div className="min-h-screen bg-[#FFFFFF] text-gray-900 font-sans">
      {/* Modules Section */}
      <section id="modules" className="py-20 px-6">
        <div className="max-w-6xl mx-auto">
          <h2 className="text-4xl font-bold text-center mb-12" style={{ color: colors.primary }}>
            Modules
            <span style={{ color: colors.accent }} className="block">
              Techniques Détaillées
            </span>
          </h2>

          <div className="grid lg:grid-cols-2 gap-8">
            {/* Modules List */}
            <div className="space-y-4">
              {modules.map((module, idx) => (
                <div
                  key={idx}
                  onClick={() => setActiveModule(idx)}
                  className={`p-6 rounded-2xl cursor-pointer transition-all border ${activeModule === idx
                      ? `border-[${colors.primary}] bg-[${colors.primary}] bg-opacity-10 shadow-lg`
                      : "border-gray-200 hover:border-[${colors.accent}]"
                    }`}
                >
                  <div className="flex items-center gap-4">
                    <div
                      className={`w-12 h-12 rounded-xl flex items-center justify-center ${activeModule === idx ? `bg-[${colors.primary}]` : "bg-gray-100"
                        }`}
                    >
                      {React.createElement(module.icon, { className: "w-6 h-6 text-[white]" })}
                    </div>
                    <h3 className="text-xl font-bold">{module.title}</h3>
                  </div>
                </div>
              ))}
            </div>

            {/* Module Detail */}
            <div className="bg-gray-50 rounded-2xl p-8 border border-gray-200">
              <div className="flex items-center gap-4 mb-6">
                <div className="w-16 h-16 bg-[${colors.primary}] rounded-2xl flex items-center justify-center">
                  {React.createElement(modules[activeModule].icon, {
                    className: "w-8 h-8 text-white",
                  })}
                </div>
                <h3 className="text-2xl font-bold">{modules[activeModule].title}</h3>
              </div>

              <ul className="space-y-3">
                {modules[activeModule].points.map((point, idx) => (
                  <li key={idx} className="flex items-start gap-3 text-gray-800">
                    <div
                      className="w-2 h-2 rounded-full mt-2"
                      style={{ backgroundColor: colors.primary }}
                    ></div>
                    <span>{point}</span>
                  </li>
                ))}
              </ul>

              <button
                className="mt-6 w-full py-3 rounded-xl font-semibold text-white"
                style={{ backgroundColor: colors.secondary }}
              >
                En Savoir Plus <ChevronRight className="inline-block w-5 h-5 ml-2" />
              </button>
            </div>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className="py-12 px-6 border-t border-gray-200 bg-gray-50">
        <div className="max-w-6xl mx-auto text-center text-gray-700">
          <div className="flex items-center justify-center gap-3 mb-4">
            <div
              className="w-8 h-8 rounded-lg flex items-center justify-center"
              style={{ backgroundColor: colors.primary }}
            >
              <Leaf className="w-5 h-5 text-white" />
            </div>
            <span className="text-xl font-bold" style={{ color: colors.primary }}>
              AgriTech Mauritanie
            </span>
          </div>
          <p>© 2025 AgriTech Mauritanie. Tous droits réservés.</p>
          <p className="mt-2 text-sm">Innovation agricole pour un avenir durable en Mauritanie</p>
        </div>
      </footer>
    </div>
  );
}
